var dashboardPlanIncomeChart = function dashboardPlanIncomeChart(data) {
  if (data == null) {
    return false;
  }
  incomeChartCanvasAttr.empty();
  incomeChartCanvasAttr.append('<canvas id="dashboardIncomeChart" class="mh-350px pt-0"></canvas>');
  var ctx = document.getElementById("dashboardIncomeChart").getContext("2d");

  // Gradient background fill
  var gradient = ctx.createLinearGradient(0, 0, 0, 400);
  gradient.addColorStop(0, "rgba(30, 58, 138, 0.4)");
  gradient.addColorStop(1, "rgba(30, 58, 138, 0.05)");
  if (data.breakDown && data.breakDown.length > 0) {
    data.breakDown[0].backgroundColor = gradient;
    data.breakDown[0].borderColor = "rgba(30, 58, 138, 1)";
    data.breakDown[0].fill = true;
  }
  var incomeChartObj = new Chart(ctx, {
    type: dashboardIncomeChartType,
    // Keep dynamic chart type switching
    data: {
      labels: data.labels,
      datasets: data.breakDown
    },
    options: {
      responsive: true,
      maintainAspectRatio: false,
      plugins: {
        legend: {
          display: false
        },
        tooltip: {
          callbacks: {
            label: function label(context) {
              var label = context.dataset.label || "";
              if (label) {
                label += ": ";
              }
              if (context.parsed.y !== null) {
                label += getCurrencyAmount(context.parsed.y.toFixed(2), getCurrencyCode);
              }
              return label;
            }
          }
        }
      },
      scales: {
        y: {
          title: {
            display: true,
            text: Lang.get("js.amount")
          },
          min: 0
        },
        x: {
          title: {
            display: true,
            text: Lang.get("js.month")
          }
        }
      }
    }
  });
  incomeChartObj.canvas.parentNode.style.height = "334px";
};
